import React from 'react';
import { useParams, Link } from 'react-router-dom';
import { Car } from '../Atoms/Carmodel';
import { Button, Typography, Card, CardContent, CardActions, Tooltip, Grid } from '@mui/material';
import { ArrowBack, ShoppingCart } from '@mui/icons-material'; // Assuming you have these icons
import backgroundImage from '../../background.jpg';

interface CarDetailsProps {
  carData: Car[];
  addToCart: (car: Car) => void;
}

const CarDetailsPage: React.FC<CarDetailsProps> = ({ carData, addToCart }) => {
  const params: { id: string } = useParams() as { id: string };

  const selectedCar = carData.find((car) => car.id === parseInt(params.id, 10));

  if (!selectedCar) {
    return <div>Auto nicht gefunden</div>;
  }

  const handleAddToCart = () => {
    addToCart(selectedCar);
  };

  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
        background: `url(${backgroundImage})`,
      }}
    >
      <Card style={{ maxWidth: '80vw', marginBottom: '20px', background: 'rgba(0,0,0, 0.7)', backdropFilter: 'blur(0.1em)' }}>
        <CardContent>
          <Typography variant="h4" component="div" gutterBottom style={{ color: 'white', marginBottom: '10px' }}>
            {selectedCar.brand} {selectedCar.model}
          </Typography>
          <Grid container spacing={2}>
            <Grid item xs={4}>
              <Typography variant="body2" color="text.secondary" style={{ color: 'white', marginBottom: '5px' }}>
                Category: {selectedCar.category}
              </Typography>
            </Grid>
            <Grid item xs={4}>
              <Typography variant="body2" color="text.secondary" style={{ color: 'white', marginBottom: '5px' }}>
                Seats: {selectedCar.seats}
              </Typography>
            </Grid>
            <Grid item xs={4}>
              <Typography variant="body2" color="text.secondary" style={{ color: 'white', marginBottom: '5px' }}>
                Horsepower: {selectedCar.horsepower}
              </Typography>
            </Grid>
            <Grid item xs={4}>
              <Typography variant="body2" color="text.secondary" style={{ color: 'white', marginBottom: '5px' }}>
                Fuel Type: {selectedCar.fuelType}
              </Typography>
            </Grid>
            <Grid item xs={4}>
              <Typography variant="body2" color="text.secondary" style={{ color: 'white', marginBottom: '5px' }}>
                Price: {selectedCar.price}
              </Typography>
            </Grid>
          </Grid>
        </CardContent>
        <CardActions style={{ display: 'flex', justifyContent: 'space-between' }}>
          <Button onClick={handleAddToCart} variant="contained" color="primary" startIcon={<ShoppingCart />} style={{ backgroundColor: 'gray', color: 'white', outline: 'none', border: 'none' }}>
            Add to Cart
          </Button>
          <div>
            <Link to="/cars" style={{ textDecoration: 'none', margin: '10px' }}>
              <Tooltip title="Back to all cars">
                <Button variant="contained" color="primary" style={{ backgroundColor: 'gray', color: 'white', borderColor: 'white' }}>
                  <ArrowBack />
                </Button>
              </Tooltip>
            </Link>
            <Link to="/payment" style={{ textDecoration: 'none', margin: '10px' }}>
              <Tooltip title="Show cart">
                <Button variant="contained" color="primary" style={{ backgroundColor: 'gray', color: 'white', borderColor: 'white' }}>
                  <ShoppingCart />
                </Button>
              </Tooltip>
            </Link>
          </div>
        </CardActions>
      </Card>
    </div>
  );
};

export default CarDetailsPage;
